INSERT INTO pcornet_enc VALUES (2, '\PCORI\ENCOUNTER\FACILITYID\', 'Facility ID', 'N', 'LI ', NULL, 'ENCOUNTER:FACILITYID', '<?xml version="1.0" encoding="UTF-8"?><ValueMetadata><Version>3.2</Version><CreationDateTime>2014-05-09T15:14:15.619-04:00</CreationDateTime><MaxStringLength/><DataType>String</DataType><Oktousevalues/></ValueMetadata>', 'patient_num', 'VISIT_DIMENSION', 'FACILITYID', 'T', 'IN', '''''', 'Added scheme to baasecode:FACILITYID', 'This column must be ETLd for the PopMedNet transform, but for privacy reasons it is not queryable. Arbitrary local facility code that identifies the hospital or clinic. Used for chart abstraction and validation.FACILITYID can be a true identifier, or a pseudoidentifier with a consistent crosswalk to the true identifier retained by the source data partner.', '@', '2014-05-09 15:14:20', '2014-05-09 15:14:20', '2014-05-09 15:14:20', 'PCORNET_CDM', NULL, NULL, '\PCORI\ENCOUNTER\', 'FACILITYID', 'ENCOUNTER:FACILITYID');
