INSERT INTO pcornet_enc VALUES (2, '\PCORI\ENCOUNTER\DRG\', 'Diagnosis Related Group', 'N', 'FA ', 0, NULL, NULL, 'concept_cd', 'CONCEPT_DIMENSION', 'concept_path', 'T', 'LIKE', '\PCORI\ENCOUNTER\DRG\', NULL, '3-digit Diagnosis Related Group (DRG). Should be populated for IP and IS encounter types. May be populated for ED encounter types. Should be missing for AV or OA encounters. Use leading zeroes for codes less than 100.The DRG is used for reimbursement for inpatient encounters. It is a Medicare requirement that combines diagnoses into clinical concepts for billing. Frequently used in observational data analyses. The DRG code version can be MS-DRG (current system), which began on 10/1/2007, or the earlier CMS-DRG.', '@', '2014-05-11 16:47:08', '2014-05-11 16:47:08', '2014-05-11 16:47:08', 'PCORNET_CDM', NULL, NULL, '\PCORI\ENCOUNTER\', 'DRG', NULL);
INSERT INTO pcornet_enc VALUES (3, '\PCORI\ENCOUNTER\DRG\01\', 'CMS-DRG (old system)', 'N', 'FA ', 0, 'DRG_TYPE:01', NULL, 'concept_cd', 'CONCEPT_DIMENSION', 'concept_path', 'T', 'LIKE', '\PCORI\ENCOUNTER\DRG\01\', NULL, '3-digit Diagnosis Related Group (DRG). Should be populated for IP and IS encounter types. May be populated for ED encounter types. Should be missing for AV or OA encounters. Use leading zeroes for codes less than 100.The DRG is used for reimbursement for inpatient encounters. It is a Medicare requirement that combines diagnoses into clinical concepts for billing. Frequently used in observational data analyses. This is the earlier CMS-DRG system.', '@', '2014-05-11 16:47:08', '2014-05-11 16:47:08', '2014-05-11 16:47:08', 'PCORNET_CDM', NULL, NULL, '\PCORI\ENCOUNTER\DRG\', '01', NULL);
